CREATE TABLE shop
(
    id     integer NOT NULL,
    npc_id integer NOT NULL,
    PRIMARY KEY (id)
);
GRANT SELECT ON TABLE shop TO ${server-username};

CREATE TABLE shop_item
(
    shop integer NOT NULL,
    item_id integer NOT NULL,
    price integer NOT NULL,
    pitch integer,
    position smallint NOT NULL,
    PRIMARY KEY (shop, item_id),
    CONSTRAINT fk_shop_item_shop FOREIGN KEY(shop) REFERENCES shop(id)
);
GRANT SELECT ON TABLE shop_item TO ${server-username};

